export const sum = function (key,props){
    if (props.isGlobal == false) {
        switch (key) {
            case 'Confirmed':
                return props.data[0].positif;
            case 'Recovered':
                return props.data[0].sembuh;
            case 'Deaths':
                return props.data[0].meninggal;
            case 'Active':
                return props.data[0].dirawat;
            default:
                return 0;
        }
    }
}
